import React from 'react';
import reactDom from 'react-dom';
import { Gallery } from './components/Galley/Gallery';

function App() {
  reactDom.render( 
    <React.StrictMode>
    <Gallery/>
    </React.StrictMode>,
    document.getElementById('root')
);
}

export default App;
